import React from 'react';

const Avatar = ( {idx} ) => {

    const xlinkHrefs = [
    "data:image/png;base64,","data:image/png;base64,"
    ];

    return (
        <>
            <circle cx="40" cy="40" r="40" fill={`url(#pattern${idx})`} />
            <defs>
                <pattern id={`pattern${idx}`} patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlinkHref={`#image${idx}`} transform="scale(0.000976562)" />
                </pattern>
                <image id={`image${idx}`} width="1024" height="1024" xlinkHref={xlinkHrefs[idx]} />
            </defs>
        </>

    );
};

export default Avatar;